import React from "react";
import "./style.css";

const bookShelf = require('./images/google_books.png') 

function Jumbotron({ children }) {
  return <div className="jumbotron mt-4">
    {children}
    <img src={bookShelf} className="bookShelf" alt="Book shelf" />
  </div>;
}

export default Jumbotron;
